  \"Report on the 2011 Wilderness Fellow Initiative : Implementing wilderness character
  monitoring in the U.S. Fish and Wildlife Service National Wildlife Refuge System\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:25:05.064655\",\n\t\"name\": \"report-on-the-2011-wilderness-fellow-initiative-implementing-wilderness-character-monitori\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the background,
  process, results, lessons learned, and recommendations from the 2011 Wilderness
  Fellows Initiative. This initiative was a new effort of the U.S. Fish & Wildlife
  Service to preserve the character of wilderness by assessing trends in wilderness
  character in the National Wildlife Refuge System (NWRS). Two questions have been
  used to frame the success of this initiative: Did it work? and Was it worthwhile?
  Following the results, the report covers recommendations for the initiatives and
  for the wilderness character monitoring in the refuge system. Appendices follow,
  which include a summary of participating refuges, summary of wilderness character
  monitoring measures by refuge, summary of wilderness character monitoring measures
  by wilderness quality and a summary of refuge project leader responses to debriefing
  questions.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
